
public class GreatestBetween {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
    int a = 34;
    int b =7;
    
    if(a==b) {
    	System.out.print("Both are equal");
    }
    if(a>b) {
    	System.out.print("A is greatest");
    }
    else{
    	System.out.print("B is greatest");
    }
	}

}
